import React from "react";
import { useSelector } from "react-redux";

const Test =  () => {
  const CurrentUser = useSelector((state) => state.user.currentUser);
  const email = CurrentUser.email;
  const id = CurrentUser.id;

  return (
    <>
      <h1>WELCOME!!!</h1>
      <h1> Your email: {email}</h1>
      <h1>Your id: {id}</h1>
    </>
  );
};

export default Test;
